import React, { Component } from "react";
import { Link } from "react-router-dom";
import {
  Badge,
  BreadcrumbItem,
  Breadcrumb,
  Container,
  Sidebar
} from "reactstrap";
class Header extends Component {
  render() {
    return (
      <div class="ui inverted menu">
        <Link class="active red item">Red</Link>
        <Link class="orange item">Orange</Link>
        <Link class="yellow item">Yellow</Link>
        <Link class="olive item">Olive</Link>
        <Link class="green item">Green</Link>
        <Link class="teal item">Teal</Link>
      </div>
    );
  }
}

export default Header;
